import React from 'react';
import { Box, Container, Grid, Typography, Link } from '@mui/material';

const Footer = () => {
  const footerSections = [
    {
      title: 'Product',
      links: ['Client Gallery', 'Website', 'Store', 'Mobile App', 'Studio Manager']
    },
    {
      title: 'Company',
      links: ['About', 'Careers', 'Contact Us', 'Terms of Service', 'Privacy Policy']
    },
    {
      title: 'Resources',
      links: ['Help Center', 'Blog', 'Feature Updates', 'Status', 'Compare']
    }
  ];

  return (
    <Box component="footer" sx={{ bgcolor: '#f5f5f5', py: 6, mt: 'auto' }}>
      <Container maxWidth="lg">
        <Grid container spacing={4}>
          {footerSections.map((section) => (
            <Grid item xs={12} sm={4} key={section.title}>
              <Typography variant="h6" color="primary" gutterBottom>
                {section.title}
              </Typography>
              {section.links.map((link) => (
                <Box key={link} sx={{ mb: 1 }}>
                  <Link
                    href="#"
                    color="textSecondary"
                    sx={{
                      textDecoration: 'none',
                      '&:hover': { color: 'primary.main' }
                    }}
                  >
                    {link}
                  </Link>
                </Box>
              ))}
            </Grid>
          ))}
        </Grid>
        <Box sx={{ mt: 4, textAlign: 'center' }}>
          <Typography variant="body2" color="textSecondary">
            Â© {new Date().getFullYear()} TheMavisuals. All rights reserved.
          </Typography>
        </Box>
      </Container>
    </Box>
  );
};

export default Footer;
